  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for LaCreek National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1959.
  The report begins by summarizing the weather conditions, water conditions, habitat
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, and wildfires.
  Resource management is outlined; topics include grazing and fur harvesting. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, and
  Refuge participation. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
